--
-- Name: alter_trigger(character, character); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION alter_trigger(character, character) RETURNS void
    LANGUAGE plpgsql
    AS $_$
BEGIN
	execute 'ALTER TABLE ' || $1 || ' ' || $2 || ' TRIGGER ALL';
END;
$_$;


