--
-- Name: carga_horaria_efetiva(bigint, bigint, bigint); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION carga_horaria_efetiva(id_curso bigint, id_turma bigint, id_colaboradorturma bigint) RETURNS interval
    LANGUAGE plpgsql
    AS $$  
	BEGIN 
		IF exists(select * from diaturma where turma_id = id_turma and horaini is not null and horaini != '' and horafim is not null and horafim != ''
			and ((horaini = '0:00' and horafim != '0:00') or (horaini != '0:00' and horafim = '0:00') or (horaini != '0:00' and horafim != '0:00')))
		THEN
			RETURN (select sum(to_timestamp(horafim, 'HH24:MI') - to_timestamp(horaini, 'HH24:MI')) as horas
			from colaboradorpresenca  cp
			inner join colaboradorturma ct on ct.id = cp.colaboradorturma_id 
			inner join diaturma dt on dt.id = cp.diaturma_id
			where curso_id = id_curso and dt.turma_id = id_turma and presenca = true
			and ct.id = id_colaboradorturma
			group by ct.id 
			order by ct.id);
		ELSE
			RETURN (select (count(cp.id)*((cargahoraria::double precision)/(select count(*) from diaturma where turma_id = id_turma))|| 'm')::interval as horas
			from colaboradorpresenca  cp
			inner join colaboradorturma ct on ct.id = cp.colaboradorturma_id 
			inner join curso cu on cu.id = curso_id
			where curso_id = id_curso and ct.turma_id = id_turma and presenca = true
			and ct.id = id_colaboradorturma
			group by ct.id, cargahoraria);
		END IF;	
	END; 
$$;


ALTER FUNCTION public.carga_horaria_efetiva(id_curso bigint, id_turma bigint, id_colaboradorturma bigint) OWNER TO postgres;

--
-- Name: dependent_tables(character varying, bigint); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION dependent_tables(tabela character varying, id bigint) RETURNS SETOF character varying
    LANGUAGE plpgsql
    AS $$
DECLARE
    rec RECORD;
    tabelas VARCHAR[];
    existe BOOLEAN;
BEGIN 
    FOR rec IN
        SELECT
            tc.table_name,
            tc.constraint_name, 
            kcu.column_name 
        FROM information_schema.table_constraints AS tc 
        INNER JOIN information_schema.key_column_usage AS kcu ON tc.constraint_name = kcu.constraint_name
        INNER JOIN information_schema.constraint_column_usage AS ccu ON ccu.constraint_name = tc.constraint_name
        WHERE constraint_type = 'FOREIGN KEY' 
        AND ccu.table_name = tabela
    LOOP
        EXECUTE 'SELECT EXISTS (SELECT * FROM ' || rec.table_name::varchar || ' WHERE ' || rec.column_name || ' = ' || id || ')' INTO existe;
        IF existe THEN
            tabelas := tabelas || rec.table_name::varchar;
        END IF;
    END LOOP;

    RETURN QUERY SELECT DISTINCT t FROM UNNEST(tabelas) AS t ORDER BY 1;
END
$$;


ALTER FUNCTION public.dependent_tables(tabela character varying, id bigint) OWNER TO postgres;

--
-- Name: monta_familia_area(bigint); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION monta_familia_area(area_id bigint) RETURNS TABLE(area_nome text)
    LANGUAGE plpgsql
    AS $$ 
DECLARE 
BEGIN 
    RETURN QUERY  
    WITH RECURSIVE areaorganizacional_recursiva AS ( 
        SELECT id, nome, areamae_id, CAST(nome AS TEXT) AS nomeHierarquico 
        FROM areaorganizacional WHERE id = area_id 
        UNION ALL 
        SELECT ao.id, ao.nome, ao.areamae_id, CAST((ao.nome || ' > ' || ao_r.nomeHierarquico) AS TEXT) AS nomeHierarquico 
        FROM areaorganizacional ao 
        INNER JOIN areaorganizacional_recursiva ao_r ON ao.id = ao_r.areamae_id 
    )
    SELECT nomeHierarquico FROM areaorganizacional_recursiva ORDER BY LENGTH(nomehierarquico) DESC LIMIT 1; 
END; 
$$;


ALTER FUNCTION public.monta_familia_area(area_id bigint) OWNER TO postgres;

--
-- Name: monta_familia_areas_filhas_by_usuario_and_empresa(bigint, bigint); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION monta_familia_areas_filhas_by_usuario_and_empresa(usuarioid bigint, empresaid bigint) RETURNS TABLE(areaid bigint, areanome text, areaativo boolean, empresa_nome text)
    LANGUAGE plpgsql
    AS $$  
DECLARE 
mviews RECORD;
BEGIN 
     FOR mviews IN 
		select area.id as area_id, e.nome as empresaNome from areaorganizacional as area  
		left join colaborador c on c.id = area.responsavel_id
		left join colaborador co on co.id = area.coresponsavel_id 
		left join usuario u on u.id = c.usuario_id or u.id = co.usuario_id 
		left join empresa e on e.id = area.empresa_id
		where u.id = usuarioId and area.empresa_id = empresaId 
		LOOP 
		RETURN QUERY 
		    (select id, cast(monta_familia_area(id) as text) as nome, ativo, CAST(mviews.empresaNome as text) as empNome from areaorganizacional where id = mviews.area_id) union 
		    ((WITH RECURSIVE areaorganizacional_recursiva AS ( 
		        SELECT id, nome, areamae_id, CAST(nome AS TEXT) AS nomeHierarquico, ativo 
		        FROM areaorganizacional WHERE areamae_id = mviews.area_id 
		        UNION ALL  
		        SELECT ao.id, ao.nome, ao.areamae_id, CAST((ao_r.nomeHierarquico || ' > ' || ao.nome) AS TEXT) AS nomeHierarquico, ao.ativo  
		        FROM areaorganizacional ao  
		        INNER JOIN areaorganizacional_recursiva ao_r ON ao.areamae_id = ao_r.id  
		    ) SELECT id, cast(((select monta_familia_area(id) as nome from areaorganizacional where id = mviews.area_id ) || ' > ' || nomeHierarquico) as text) as nome, ativo, CAST(mviews.empresaNome as text) as empNome
		      FROM areaorganizacional_recursiva) ORDER BY nome); 
      END LOOP; 
    RETURN;  
END;  
$$;


ALTER FUNCTION public.monta_familia_areas_filhas_by_usuario_and_empresa(usuarioid bigint, empresaid bigint) OWNER TO postgres;

